import {useParams} from "react-router-dom";
import {Fragment} from "react";

const QuoteDetail = () => {
    const params = useParams();
    console.log(params.quoteId);

    return (
        <Fragment>
            <h1>Quote Detail</h1>
            <p>{params.quoteId}</p>
        </Fragment>
    )
}

export default QuoteDetail;
